import React, { useState } from "react";
import universityData from "./universityData";
import jsPDF from "jspdf";
import "jspdf-autotable";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(universityData[0]);
  const [selectedSubject, setSelectedSubject] = useState(universityData[0].subjects[0]);
  const [selectedProgram, setSelectedProgram] = useState("Masters");
  const [selectedStudentType, setSelectedStudentType] = useState("International");
  const [cgpa, setCgpa] = useState("");
  const [sat, setSat] = useState("");
  const [savedReports, setSavedReports] = useState([]);

  const convertCgpaToGpa = (cgpa) => (cgpa / 10) * 4;

  const selectedSubjectData =
    selectedUniversity.subjectDetails[selectedSubject]?.[selectedProgram];

  const estimateAdmissionProbability = () => {
    if (!selectedSubjectData || !cgpa || !sat) return "Enter both CGPA and SAT";
    const gpa = convertCgpaToGpa(parseFloat(cgpa));
    const gpaCutoff = parseFloat(selectedSubjectData.gpaCutoff);
    const satCutoff = parseInt(selectedSubjectData.satCutoff);

    if (gpa >= gpaCutoff && sat >= satCutoff) return "Highly Likely";
    if (gpa >= gpaCutoff - 0.2 || sat >= satCutoff - 30) return "Likely";
    if (gpa >= gpaCutoff - 0.5 || sat >= satCutoff - 100) return "Doubtful";
    return "Unlikely";
  };

  const saveReport = () => {
    const report = {
      university: selectedUniversity.name,
      subject: selectedSubject,
      program: selectedProgram,
      studentType: selectedStudentType,
      cgpa,
      sat,
      admissionChance: estimateAdmissionProbability(),
    };
    setSavedReports([...savedReports, report]);
  };

  const downloadPDF = () => {
    const doc = new jsPDF();
    doc.text("Admission Report", 14, 16);
    const tableColumn = [
      "University",
      "Subject",
      "Program",
      "Student Type",
      "CGPA",
      "SAT",
      "Chance",
    ];
    const tableRows = savedReports.map((report) => [
      report.university,
      report.subject,
      report.program,
      report.studentType,
      report.cgpa,
      report.sat,
      report.admissionChance,
    ]);
    doc.autoTable(tableColumn, tableRows, { startY: 20 });
    doc.save("admission_report.pdf");
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>{selectedUniversity.name}</h1>
      <h3>QS World Rank: {selectedUniversity.generalRank}</h3>

      <div>
        <label>Select Subject: </label>
        <select
          value={selectedSubject}
          onChange={(e) => {
            setSelectedSubject(e.target.value);
            setSelectedProgram("Masters");
          }}
        >
          {selectedUniversity.subjects.map((subject) => (
            <option key={subject} value={subject}>
              {subject}
            </option>
          ))}
        </select>
      </div>

      <div>
        <label>Select Program: </label>
        <select
          value={selectedProgram}
          onChange={(e) => setSelectedProgram(e.target.value)}
        >
          <option value="Bachelors">Bachelors</option>
          <option value="Masters">Masters</option>
          <option value="PhD">PhD</option>
        </select>
      </div>

      <div>
        <label>Student Type: </label>
        <select
          value={selectedStudentType}
          onChange={(e) => setSelectedStudentType(e.target.value)}
        >
          <option value="International">International</option>
          <option value="Domestic">Domestic</option>
        </select>
      </div>

      <div>
        <label>Enter your CGPA (out of 10): </label>
        <input
          type="number"
          step="0.1"
          value={cgpa}
          onChange={(e) => setCgpa(e.target.value)}
        />
      </div>

      <div>
        <label>Enter your SAT Score: </label>
        <input
          type="number"
          value={sat}
          onChange={(e) => setSat(e.target.value)}
        />
      </div>

      <h3>
        Estimated Admission Chance: {estimateAdmissionProbability()}
      </h3>

      {selectedSubjectData && (
        <>
          <h3>QS Rankings Over Years:</h3>
          <ul>
            {selectedSubjectData.qsRankingsOverYears.map((rank, idx) => (
              <li key={idx}>{2025 - 4 + idx}: {rank}</li>
            ))}
          </ul>

          <p>
            <strong>Course Start Date:</strong> {selectedSubjectData.startDate}
          </p>
          <p>
            <strong>Tuition Fees:</strong> {selectedSubjectData.fees}
          </p>
          <p>
            <strong>Eligibility ({selectedStudentType}):</strong>{" "}
            {selectedSubjectData.eligibility[selectedStudentType]}
          </p>
          <p>
            <strong>GPA Cutoff:</strong> {selectedSubjectData.gpaCutoff}
          </p>
          <p>
            <strong>SAT Cutoff:</strong> {selectedSubjectData.satCutoff}
          </p>
          <p>
            <strong>Course Link: </strong>
            <a href={selectedSubjectData.courseLink} target="_blank" rel="noreferrer">
              View Course
            </a>
          </p>
        </>
      )}

      <button onClick={saveReport}>Save Report</button>
      <button onClick={downloadPDF}>Download PDF</button>
    </div>
  );
}

export default App;
